  \"2016-07-27T22:45:37.371947\",\n\t\"name\": \"des-lacs-migratory-waterfowl-refuge-quarterly-narrative-report-november-1938-december-193-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs and
  Lostwood Migratory Waterfowl Refuges outlines Refuge accomplishments from November
  1938 through January of 1939. The report begins by summarizing the weather conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, and predators- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses. Photographs are attached.\",\n\t\"license_title\":
